import React, { useState } from "react";
import {
  MDBBtn,
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,
  MDBModalTitle,
  MDBModalBody,
  MDBModalFooter,
} from "mdb-react-ui-kit";

export default function mpcModal() {
  const [scrollableModal, setScrollableModal] = useState(false);

  return (
    <>
      <MDBBtn
        size="lg"
        className="m-2"
        style={{
          fontWeight: "600",
          padding: "20px 50px 20px 50px",
          fontSize: "16px",
        }}
        onClick={() => setScrollableModal(!scrollableModal)}
      >
        Mortgage Payment
      </MDBBtn>

      <MDBModal
        show={scrollableModal}
        getOpenState={(e: any) => setScrollableModal(e)}
        tabIndex="-1"
      >
        <MDBModalDialog scrollable>
          <MDBModalContent>
            <MDBModalHeader>
              <MDBModalTitle>Moving Checklist</MDBModalTitle>
              <MDBBtn
                className="btn-close"
                color="none"
                onClick={() => setScrollableModal(!scrollableModal)}
              ></MDBBtn>
            </MDBModalHeader>
            <MDBModalBody>
              <MDBInputGroup noWrap>
                <MDBInputGroupElement type="text" placeholder="Mortgage Amount" />
                <MDBInputGroupElement type="text" placeholder="Down Payment" />
                <MDBInputGroupElement type="text" placeholder="Mortgage Term" />
                <MDBInputGroupElement type="text" placeholder="Interest Rate" />
              </MDBInputGroup>
            </MDBModalBody>
            <MDBModalFooter>
              <MDBBtn
                style={{
                  fontWeight: "400",
                  fontSize: "16px",
                }}
                onClick={() => setScrollableModal(!setScrollableModal)}
              >
                Close
              </MDBBtn>
              <MDBBtn
                rippleColor="success"
                style={{
                  color: "black",
                  fontWeight: "400",
                  backgroundColor: "white",
                  fontSize: "16px",
                }}
              >
                Print
              </MDBBtn>
            </MDBModalFooter>
          </MDBModalContent>
        </MDBModalDialog>
      </MDBModal>
    </>
  );
}
